import React from "react";
import s from "./Dialogs.module.css";

const Dialogs = (props) => {
  return (
    <div className="dialogs">
      <div className="dialogs-items">
        <div className="item">Viktor</div>
        <div className="item">Alex</div>
        <div className="item">John</div>
        <div className="item">Frank</div>
        <div className="item">Maxym</div>
      </div>
    </div>
  );
};

export default Dialogs;
